import React from 'react'

const InvoiceContainer = () => {
    return (
        <div className="mt-24 space-y-6">
            {data.slice(0, 6).map((invoice) => {
                return (
                    <div key={invoice._id} >
                        <Link to={`/${invoice._id}`}>
                            <InvoiceItem props={invoice} />
                        </Link>
                    </div>
                )
            })}
        </div>
    )
}

export default InvoiceContainer
